const mainSlideCall = () =>{

    const slideCall = (set,update,time) =>{

        console.log(set)
        console.log(update)
        
        set(true)
        setTimeout(()=>{
            set(false)
            update();
        },time)
        };
    
    return [slideCall];    
}

export default mainSlideCall;
